import React from 'react';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import GridListTileBar from '@material-ui/core/GridListTileBar';

export default function Upcomingmoviesgridlist() {

  

  return (
    <div>
        <GridList cellHeight={200} cols={6} style={{ width: 800, height: 600 }}>
        {upComingMoviesList.map((data) => (
          <GridListTile key={data.id}>
            <img src={data.poster_url} alt={data.upComingMovieName} />
          </GridListTile>
        ))}
        </GridList>
    </div>
  );
}
